import data from './data.json'
function Menu() {
    const listPizza = data.Pizza.map((elem) =>
        <ul>
            <li key="1">{elem.name}</li>
            <li key="2">{elem.price}</li>
            <li key="3">{elem.price}</li>
        </ul>
    );
    return (
        <div>
            <p>Menu!</p>
            {listPizza}
        </div>
        );
}
export default Menu;
